import React, { Component } from 'react';
import Select from 'react-select';
import 'bootstrap/dist/css/bootstrap.min.css';


const flow = [
  { label: "1", value: 1 },
  { label: "2", value: 2 },
  { label: "3", value: 3 },
  { label: "4", value: 4 },
  { label: "5", value: 5 },
  { label: "6", value: 6 }];

class LogFilter extends Component {

    render() {


        return (
            <div className="container" style={{
                paddingTop: "60px"
              }}>
                <h5 style={{
                    paddingLeft:"10px",
                    borderLeft: "5px solid #555555"
                }}>Error Log Filter</h5>

                <row> <Select className="mt-2 col-md-2 col-offset-4" options={flow} style={{
                    padding: "10px"
                }}>Flow:</Select></row>
            </div>

        )
    }
}

export default LogFilter;
